import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
const API_KEY = "AIzaSyAth7L9k8Xmpl9e5GSfeW68N1ThaSp0WAs"; 

const eventFiles = require.context("./events", false, /\.json$/);
const eventsData = eventFiles.keys().map((key) => eventFiles(key));

const DisciplineLive = () => {
  const { eventName, disciplineName } = useParams();
  const navigate = useNavigate();
  const [data, setData] = useState([]);
  const [headers, setHeaders] = useState([]);
  const [googleSheetsId, setGoogleSheetsId] = useState("");
  const [sheetName, setSheetName] = useState("");
  const [rowRange, setRowRange] = useState([0, 0]);
  const [selectedColumns, setSelectedColumns] = useState([]);

  // 1️⃣ Načtení eventu a disciplíny z JSON souboru
  useEffect(() => {
    const fetchEventData = async () => {
      try {
        const event = eventsData.find(
          (e) => e.name.replace(/\s+/g, "-").toLowerCase() === eventName
        );

        if (event) {
          setGoogleSheetsId(event.googleSheetsId);

          const discipline = event.disciplines
            .flatMap((day) => day.events)
            .find(
              (d) =>
                d.name.replace(/\s+/g, "-").toLowerCase() === disciplineName
            );

          if (discipline) {
            setSheetName(discipline.sheetName);
            setRowRange(discipline.rowRange);
            setSelectedColumns(discipline.columns);
          } else {
            console.error("Disciplína nenalezena:", disciplineName);
          }
        } else {
          console.error("Event nenalezen:", eventName);
        }
      } catch (error) {
        console.error("Chyba při načítání JSON:", error);
      }
    };

    fetchEventData();
  }, [eventName, disciplineName]);

  // 2️⃣ Načítání dat z Google Sheets
  useEffect(() => {
    if (!googleSheetsId || !sheetName || rowRange[0] === 0) return;

    const fetchDataFromSheets = async () => {
      const range = `${sheetName}!A${rowRange[0]}:Z${rowRange[1]}`; // Načteme jen vybraný rozsah řádků
      const url = `https://sheets.googleapis.com/v4/spreadsheets/${googleSheetsId}/values/${range}?key=TVUJ_GOOGLE_API_KLIC`;

      try {
        const response = await fetch(url);
        const data = await response.json();

        if (!data.values) {
          console.error("Žádná data nebyla nalezena pro rozsah:", range);
          return;
        }

        // Najdeme indexy sloupců podle JSON
        const allHeaders = data.values[0]; // První řádek je záhlaví tabulky
        const columnIndexes = selectedColumns.map((col) =>
          allHeaders.indexOf(col)
        );

        // Pokud nějaký sloupec chybí, logujeme chybu
        columnIndexes.forEach((index, i) => {
          if (index === -1) {
            console.warn(
              `Sloupec "${selectedColumns[i]}" nebyl nalezen v listu ${sheetName}`
            );
          }
        });

        // Formátujeme data
        const formattedData = data.values.slice(1).map((row) =>
          columnIndexes.map((index) => (index !== -1 ? row[index] : ""))
        );

        setHeaders(selectedColumns);
        setData(formattedData);
      } catch (error) {
        console.error("Chyba při načítání dat z Google Sheets:", error);
      }
    };

    fetchDataFromSheets();
    const interval = setInterval(fetchDataFromSheets, 30000); // Aktualizace každých 30 sekund
    return () => clearInterval(interval);
  }, [googleSheetsId, sheetName, rowRange, selectedColumns]);

  return (
    <div className="p-4">
      {/* Tlačítko zpět */}
      <button onClick={() => navigate(`/event/${eventName}`)}>
        ⬅️ Back to {eventName.replace(/-/g, " ")}
      </button>

      {/* Název disciplíny */}
      <h1 className="text-3xl font-bold mt-4">
        {disciplineName.replace(/-/g, " ")}
      </h1>
      <p className="text-gray-600">Live Results</p>

      {/* Tabulka výsledků */}
      <table className="w-full border-collapse border border-gray-300 mt-4">
        <thead>
          <tr className="bg-gray-200">
            {headers.map((header, index) => (
              <th key={index} className="border border-gray-300 p-2">
                {header}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index} className="text-center">
              {row.map((cell, cellIndex) => (
                <td key={cellIndex} className="border border-gray-300 p-2">
                  {cell}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DisciplineLive;
